import React, { useState } from 'react';
import axios from "axios";

const Create = () => {
    const [name,SetName] = useState("");
    const [email,SetEmail] = useState("");

    const handlesubmit = ()=>{
        axios.post(
            'https://64be179a2320b36433c80a7d.mockapi.io/project',
            {name : name }
        )

    }

  return (
    <>
    <h2>Create</h2>
    <form>
    <div class="mb-3">
    <label for="text" className="form-label">Name</label>
    <input type="name" className="form-control" name='name' onChange={(e)=>{SetName(e.target.value)}}/>
    </div>
    <div class="mb-3">
    <label for="email" class="form-label">Email</label>
    <input type="email" className="form-control" name='email' onChange={(e)=>{SetEmail(e.target.value)}}/>
    </div>
    <button type="submit" className='btn btn-primary' onClick={handlesubmit}>Submit</button>
    </form>
    </>
  )
}

export default Create;
